pragma solidity ^0.8.0;


contract UIntConverter {
    function UInt64ToUInt256(uint64 val_) public pure returns (uint256) {
        return uint256(val_) * 10**10;
    }

    function UInt256ToUInt64(uint256 val_) public pure returns (uint64) {
        uint256 ret = val_ / 10**10;
        assert(ret*10**10<=val_);
        return uint64(ret);
    }

    function UInt48ToUInt256(uint48 val_) public pure returns (uint256) {
        return uint256(val_) * 10**11;
    }

    function UInt256ToUInt48(uint256 val_) public pure returns (uint48) {
        return uint48(val_ / 10**11);
    }

    function UInt32ToUInt256(uint32 val_) public pure returns (uint256) {
        return uint256(val_) * 10**12;
    }

    function UInt256ToUInt32(uint256 val_) public pure returns (uint32) {
        return uint32(val_ / 10**12);
    }
}
